export type MutationResolvers<
  ContextType = any,
  ParentType extends ResolversParentTypes['Mutation'] = ResolversParentTypes['Mutation']
> = ResolversObject<{
  targetCreate: Resolver<
    Maybe<ResolversTypes['Target']>,
    ParentType,
    ContextType,
    RequireFields<MutationTargetCreateArgs, 'input' | 'user_id'>
  >;
  targetDelete: Resolver<
    Maybe<ResolversTypes['Boolean']>,
    ParentType,
    ContextType,
    RequireFields<MutationTargetDeleteArgs, 'target_id'>
  >;
  targetUpdate: Resolver<
    Maybe<ResolversTypes['Target']>,
    ParentType,
    ContextType,
    RequireFields<MutationTargetUpdateArgs, 'input' | 'target_id'>
  >;
  timePieceCreate: Resolver<
    Maybe<ResolversTypes['TimePiece']>,
    ParentType,
    ContextType,
    RequireFields<MutationTimePieceCreateArgs, 'input' | 'target_id'>
  >;
  timePieceDelete: Resolver<
    Maybe<ResolversTypes['Boolean']>,
    ParentType,
    ContextType,
    RequireFields<MutationTimePieceDeleteArgs, 'timepiece_id'>
  >;
  timePieceUpdate: Resolver<
    Maybe<ResolversTypes['TimePiece']>,
    ParentType,
    ContextType,
    RequireFields<MutationTimePieceUpdateArgs, 'input' | 'timepiece_id'>
  >;
  timePiecesCreateForTarget: Resolver<
    Maybe<Array<ResolversTypes['TimePiece']>>,
    ParentType,
    ContextType,
    RequireFields<MutationTimePiecesCreateForTargetArgs, 'input' | 'target_id'>
  >;
  userCreate: Resolver<
    Maybe<ResolversTypes['User']>,
    ParentType,
    ContextType,
    RequireFields<MutationUserCreateArgs, 'input'>
  >;
  userUpdate: Resolver<
    Maybe<ResolversTypes['User']>,
    ParentType,
    ContextType,
    RequireFields<MutationUserUpdateArgs, 'input' | 'user_id'>
  >;
}>;

